class Node(object):    def __init__(self, data):        self.data = data        self.next = None        self.prev = Noneclass DoubleLinkList(object):    def __init__(self):        self.head = None    # Add new elements    def push(self, new_val):        new_node = Node(new_val)        new_node.next = self.head        if self.head is not None:            self.head.prev = new_node        self.head = new_node    # print the double link list    def display(self, node):        while node is not None:            print(node.data, end=' ')            last = node            node = node.nextdl_list = DoubleLinkList()dl_list.push(12)dl_list.push(8)dl_list.push(62)dl_list.display(dl_list.head)